import './skills.css';
import UIDesign from "../../asset/uidesign.png"
import WebDesign from "../../asset/webdesign.png"
import AppDesign from "../../asset/appdesign.png"

const Skills = () => {
    return (
        <section id='skills'>
            <span className='skillTitle'> What I do</span>
            <span className='SkillDesc'> JAVA SCRIPT</span>
            <div className='skillBars'>
                <img src="" alt="" className='skillBarImg' />

            </div>
        </section>
    );
}

export default Skills
